import React from "react";
import {
  Button,
  Grid,
  Paper,
  Snackbar,
  Stack,
  TextField,
  Typography,
} from "@mui/material";
import { styled } from "@mui/material/styles";
import CheckIcon from "@mui/icons-material/Check";
import MuiAlert from '@mui/material/Alert';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
  height: 55,
}));

const Profile = () => {
    const Alert = React.forwardRef(function Alert(props, ref) {
        return <MuiAlert elevation={6} ref={ref} variant="filled" {...props} />;
    });
    const [open, setOpen] = React.useState(false);

    const handleClick = () => {
        setOpen(true);
    };

    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return;
        }

        setOpen(false);
    };

    function ColorAlerts() {
        return (
            <Alert severity="success" color="info">
                This is a success alert — check it out!
            </Alert>
    );
  }
  return (
    <>
      <Grid container spacing={1}>
        <Grid item xs={4}>
          <Item>
            <Typography sx={{ paddingTop: 1 }}>Firstname</Typography>
          </Item>
        </Grid>
        <Grid item xs={5}>
          <TextField></TextField>
        </Grid>
        <Grid item xs={3}>
          <Button sx={{ paddingTop: 2, paddingLeft: 4 }} onClick={handleClick}>
            <CheckIcon />
          </Button>
        </Grid>
        <Grid item xs={4}>
          <Item>
            <Typography sx={{ paddingTop: 1 }}>Lastname</Typography>
          </Item>
        </Grid>
        <Grid item xs={5}>
          <TextField>
            <Button
              onClick={() => {
                alert("i click");
              }}
            >
              set
            </Button>
          </TextField>
        </Grid>
        <Grid item xs={3}>
          <Button sx={{ paddingTop: 2, paddingLeft: 4 }}onClick={handleClick}>
            <CheckIcon />
          </Button>
        </Grid>
        <Grid item xs={4}>
          <Item>
            <Typography sx={{ paddingTop: 1 }}>BirthDate</Typography>
          </Item>
        </Grid>
        <Grid item xs={5}>
          <TextField></TextField>
        </Grid>
        <Grid item xs={3}>
          <Button sx={{ paddingTop: 2, paddingLeft: 4 }}onClick={handleClick}>
            <CheckIcon />
          </Button>
        </Grid>
      </Grid>
      <Snackbar open={open} autoHideDuration={6000} onClose={handleClose}>
        <Alert onClose={handleClose} severity="success" sx={{ width: '100%' }}>
          The change was succesfully!!
        </Alert>
      </Snackbar>
    </>
  );
};

export default Profile
